import React from 'react'
const CreativityPage = () => {
    return ( 
    <div className="w3-container" style={{ padding: '0.01em 16px', fontSize: '1.1em' }} >
        <div className="w3-margin-top w3-round-xlarge w3-light-gray">
        <div className="w3-container w3-cell ">
          <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{ margin: '1em 0.2em 1em 0.4em', width: '60px' }} />
        </div>
        <div className="w3-container w3-cell">
          <p  style={{fontSize: '1.2em',marginBottom: '0.5em' }} >Never knew Shreya had skills. Highly valued & recommended.</p>
          <p><b className="">-Sangeetha, mother of Shreya</b></p>
        </div>
      </div>
    </div> );
}

export default CreativityPage;
